import React, { useEffect } from 'react';
import axios from 'axios';

function App() {

  useEffect(() => {
    const getData = () => {
      try {
        const data = axios.get("http://localhost:8080/todos/all");
        console.log(data);
      } catch (error) {
        console.log(error);
      }
    }
  },[])

  return (
    <div>
    </div>
  )
}

export default App
